import React from 'react'
import './Home.css'
import Widgets from '../Widgets/Widgets';
import AddNew from '../Add_New/AddNew';
import Layout from '../Layout/Layout';

function Home() {
  return (
    <div className="">
        <Layout>
            <div className="widgets">
              <Widgets type="USER"/>
              <Widgets type="INVENTORY"/>
              <Widgets type="ORDERS"/>
            </div>
            <div className="add-new-user">
              <AddNew />
            </div>
        </Layout>
    </div>
  )
}

export default Home
